import React from 'react'

const Comments = ({comments}) => {
  const commentList = comments.map((comment) =>
  <div>
    {comment.name}
    </div>
  );
  return (
    <div className="definition-wrapper definitions">
      {commentList}
    </div>
  )
}

export default Comments
